// App.js

import React from 'react';
import './App.css';
import logo from './logo.png'; // Import the logo image
import headerImage from './header-image-small.png'; // Import the header image

function App() {
  return (
    <div className="App">
      <header className="Header">
        <img src={headerImage} alt="Header" className="HeaderImage" />
      </header>
      <div className="Content">
        <div className="Logo">
          <img src={logo} alt="Logo" />
        </div>
        <iframe src="https://misplacedmusing.substack.com/embed" width="480" height="320" style={{ border: "1px solid #EEE", background: "white" }} frameborder="0" scrolling="no"></iframe>
      </div>
    </div>
  );
}

export default App;
